import React from 'react';
import { withStyles } from "@material-ui/styles";
import ChipsRow from './ChipsRow';
import TeamMemberRow from "./TeamMemberRow";

const styles = {
  halfWidthWrapper: {
    padding: "0px 48px",
    paddingTop: "24px",
    width: "100%",
    background: "white",
    boxSizing: "border-box",
    border: "1px solid black",

    display: "grid",
    gridTemplateColumns: "50% 50%",
  },
  halfSizeContainer: {
    boxSizing: "border-box",
    border: "1px solid green",
    // width: "50%",
  }
};

function ProjectIntro(props) {

  const { classes } = props;
  return (
    <div className={classes.halfWidthWrapper}>

      <div className={classes.halfSizeContainer}>
        <div>
          <p>Cash On delivery is an new payment option that issued for the SEA market</p>
          <div className={classes.metrics}>
            <ChipsRow />
          </div>
        </div>
      </div>

      <div className={classes.halfSizeContainer}>
        <TeamMemberRow />
      </div>

    </div>
  )
};

export default withStyles(styles)(ProjectIntro);
